    <body>
        <div id="app">
            <div class="sucodeBg">
                <p class="update">everytime when sb asks</p>
                <script type="text/javascript">
                  function getTime() {
                    var t=new Date();
                    var y=t.getFullYear();
                    var m=t.getMonth()+1;
                    var d=t.getDate();
                    var hh=t.getHours();
                    var mm=t.getMinutes();
                    var ss=t.getSeconds();
                    document.getElementsByClassName("update")[0].innerHTML=(m<10?"0":"")+m+(d<10?"0":"-")+d+(hh<10?" 0":" ")+hh+(mm<10?":0":":")+mm+(ss<10?":0":":")+ss;
                  }
                 getTime();
                 setInterval(getTime,1000);
                </script>
            </div>
        </div>
